    <div class="hero9m3p7q" id="home9k3m2p">
        <h1>ArtexHome Photo Booth Rentals</h1>
        <p>Transform your celebrations into unforgettable memories with our professional photo booth experiences. Capturing smiles, laughter, and magical moments since 2015.</p>
        <a href="#services7k2m3p" class="cta5k8n2x">Explore Our Services</a>
    </div>

    <div class="container7p2m9k">
        
        <section class="section4n8x1q" id="services7k2m3p">
            <h2>Our Photo Booth Services</h2>
            <p>At ArtexHome, we specialize in providing exceptional photo booth rental experiences for all types of events. Our commitment to quality and customer satisfaction has made us a trusted name in the industry. Whether you're planning a wedding, corporate gathering, birthday celebration, or any special occasion, we have the perfect solution to capture those precious moments.</p>
            
            <a href="#packages2k8m3p" class="clickcontinue8k3m2p">Click Here to Continue</a>
            
            <div class="grid3x7m2k">
                <div class="card9k4p2x">
                    <h4>Wedding Celebrations</h4>
                    <img src="https://images.pexels.com/photos/265722/pexels-photo-265722.jpeg?auto=compress&cs=tinysrgb&w=600" alt="Wedding Photo Booth" class="img2m8k4p">
                    <p>Make your special day even more memorable with our elegant photo booth setups. We provide customized backdrops, props, and instant printing services that your guests will absolutely adore. Our professional attendants ensure everything runs smoothly throughout your celebration.</p>
                </div>
                
                <div class="card9k4p2x">
                    <h4>Corporate Events</h4>
                    <img src="https://images.pexels.com/photos/1181406/pexels-photo-1181406.jpeg?auto=compress&cs=tinysrgb&w=600" alt="Corporate Event Photo Booth" class="img2m8k4p">
                    <p>Enhance your corporate gatherings, product launches, and team building events with our professional photo booth services. We offer branded templates, social media integration, and data collection features perfect for business networking and marketing initiatives.</p>
                </div>
                
                <div class="card9k4p2x">
                    <h4>Birthday Parties</h4>
                    <img src="https://images.pexels.com/photos/1729797/pexels-photo-1729797.jpeg?auto=compress&cs=tinysrgb&w=600" alt="Birthday Photo Booth" class="img2m8k4p">
                    <p>Create lasting memories at birthday celebrations for all ages. From children's parties to milestone birthdays, our photo booths add an element of fun and entertainment that keeps guests engaged and creates wonderful keepsakes for years to come.</p>
                </div>
            </div>

            <div class="highlight2k8m3p">
                <h3>Why Choose ArtexHome?</h3>
                <p>We understand that every event is unique, which is why we offer customizable packages tailored to your specific needs. Our state-of-the-art equipment, professional staff, and attention to detail ensure that your photo booth experience exceeds expectations. We don't just provide a service; we create an experience that your guests will talk about long after the event ends.</p>
            </div>
        </section>

        <section class="section4n8x1q" id="about4k8m2p">
            <h2>About ArtexHome</h2>
            <img src="https://images.pexels.com/photos/1105666/pexels-photo-1105666.jpeg?auto=compress&cs=tinysrgb&w=800" alt="Photo Booth Setup" class="img2m8k4p">
            
            <p>ArtexHome was founded with a simple mission: to bring joy and create lasting memories through innovative photo booth experiences. What started as a small operation with a single booth has grown into a comprehensive event photography service that serves hundreds of satisfied clients each year.</p>
            
            <p>Our team consists of passionate professionals who understand the importance of capturing life's special moments. We invest in the latest technology and continuously update our equipment to ensure the highest quality photos and the most engaging user experience. From classic enclosed booths to modern open-air setups, we have options to suit every venue and aesthetic preference.</p>

