            <h3>3. Booking and Payment</h3>
            <p>A non-refundable deposit of 50% of the total service fee is required to secure your booking. The remaining balance is due two weeks prior to your event date. Failure to pay the balance by the due date may result in cancellation of your booking and forfeiture of your deposit. We accept payment via credit card, bank transfer, or certified check.</p>
            
            <h3>4. Cancellation Policy</h3>
            <p>Cancellations made more than 60 days before the event date will receive a refund of 50% of the deposit. Cancellations made 30-60 days before the event will receive a 25% refund of the deposit. Cancellations made less than 30 days before the event are not eligible for any refund. We understand that circumstances change, and we will work with you to reschedule when possible.</p>
            
            <h3>5. Event Requirements</h3>
            <p>The client is responsible for providing adequate space for the photo booth setup (minimum 10x10 feet), access to a standard electrical outlet within 20 feet of the setup location, and a covered area if the event is outdoors. The client must also provide parking for our vehicle within reasonable proximity to the venue.</p>
            
            <h3>6. Setup and Breakdown</h3>
            <p>Our team will arrive 60-90 minutes before the scheduled start time to set up the equipment. We require access to the venue during this time. Breakdown typically takes 30-45 minutes after the event concludes. Any delays in accessing the venue or extended breakdown time due to venue restrictions may result in additional fees.</p>
            
            <h3>7. Equipment and Property</h3>
